import React from "react";
import { Search } from "./svg/Search";
import { Sidebar } from "./SideBar";
import { Burger } from "./svg/Burger";

export const Navbar = (props) => {
	return (
		<nav className="sticky top-0">
			<div className="flex bg-[#050833] p-8 md:px-14 justify-between items-center text-white ">
				<div>
					<h1 className="font-bold text-2xl">LOGO</h1>
				</div>
				<div className="flex items-center">
					<ul className="sm:flex gap-5 hidden md:flex items-center">
						<li>Team</li>
						<li>About</li>
						<div className="items-center flex gap-1 border p-1 rounded-md bg">
							<input placeholder="search..." type="text" className="bg-transparent focus:outline-none z-20" />
							<div className="w-[1px] h-6 bg-white" />
							<button className="">
								<Search />
							</button>
						</div>
					</ul>
					<Burger />


				</div>
			</div>
		</nav>
	);
};
